import React from 'react'
import Card from './Card'


const List = () => {



  return (

    <div className='list_css'>
        {
        allcards.map(card =>{
          return <Card 
          key={card.id}
          card={card}
          />
        })
      }
       
    </div>
  )
}

export default List
